%------ Solving system of ODEs analytically using Laplace Transform ------%

%%  Variables and parameters
syms s
syms ic1(t) ibp1(t) ibn1(t) ifp1(t) ifn1(t) vbp1(t) vbn1(t)
syms ic2(t) ibp2(t) ibn2(t) ifp2(t) ifn2(t) vbp2(t) vbn2(t)
syms dic1 dibp1 dibn1 difp1 difn1
syms dic2 dibp2 dibn2 difp2 difn2
syms Vdc Rf Ra1 La1 Cb1 Cb2 Ra2 La2 Ldc1 Ldc2 Rdc1 Rdc2 positive
syms ta1 ta2 tdc tfdc1 tfdc2 tdc1 tdc2 w1dc1 w2dc2 wa1 wa2 wdc1 wdc2 Ldc Rdc

% Defining equivalent parameters to reduce the expression size
% Rdc = Rdc1 + Rdc2;     Ldc = Ldc1 + Ldc2;
% ta1 = Ra1/La1;         ta2 = Ra2/La2;
% tfdc1 = Rf/(Ldc1);     tfdc2 = Rf/Ldc2;
% tdc1 = Rdc1/(Ldc1);    tdc2 = Rdc2/(Ldc2);    % tdc = Rdc/(Ldc);
% wa1 = 1/(Cb1*La1);     wa2 = 1/(Cb2*La2);
% wdc1 = 1/(Cb1*Ldc);    wdc2 = 1/(Cb2*Ldc);
% w1dc1 = 1/(Cb1*Ldc1);  w2dc2 = 1/(Cb2*Ldc2);

% Defining differential equations (using equivalent parameters)
ode1 = diff(ic1(t),t) == -Cb1*wa1*(vbn1 - Vdc + vbp1) - ta1*ic1;
ode2 = diff(ibp1(t),t) == -Cb1*wa1*Vdc + Cb1*wa1*vbn1 + Cb1*(w1dc1 + wa1)*vbp1 - ic1*(tdc1 - ta1 + tfdc1) - ibp1*(tdc1 + tfdc1) - ibp2*tfdc1 - ic2*tfdc1;
ode3 = diff(ibn1(t),t) == -Cb1*wa1*Vdc + Cb1*vbn1*(wa1+wdc1) - Cb2*wdc2*vbn2 + Cb1*wa1*vbp1 - tdc*ibn1 - ic1*(tdc - ta1);
ode4 = diff(ic2(t),t) == -Cb2*wa2*(vbn2 - Vdc + vbp2) - ta2*ic2;
ode5 = diff(ibp2(t),t) == -Cb2*wa2*Vdc + Cb2*w2dc2*vbp2 + Cb2*wa2*vbn2 + vbp2*Cb2*wa2 - ibp2*(tfdc2+tdc2) + ic2*(-tdc2 + ta2 - tfdc2) - ibp1*tfdc2 - ic1*tfdc2;
ode6 = diff(ibn2(t),t) == vbn2*Cb2*(wa2+wdc2) - Cb2*wa2*Vdc - Cb1*wdc1*vbn1 + Cb2*wa2*vbp2 + ibn1*tdc + ic1*tdc + ic2*ta2;
ode7 = diff(vbp1(t),t) == -ibp1/Cb1;
ode8 = diff(vbn1(t),t) == -ibn1/Cb1;
ode9 = diff(vbp2(t),t) == -ibp2/Cb2;
ode10 = diff(vbn2(t),t) == -ibn2/Cb2;

% Transform the differential equations to the Laplace domain
eqn1LT = laplace(ode1,t,s); eqn2LT = laplace(ode2,t,s); eqn3LT = laplace(ode3,t,s);
eqn4LT = laplace(ode4,t,s); eqn5LT = laplace(ode5,t,s); eqn6LT = laplace(ode6,t,s);
eqn7LT = laplace(ode7,t,s); eqn8LT = laplace(ode8,t,s); eqn9LT = laplace(ode9,t,s); eqn10LT = laplace(ode10,t,s);

% Rename the Laplace transforms by its variables names
syms Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2
eqn1LT = subs(eqn1LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn2LT = subs(eqn2LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn3LT = subs(eqn3LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn4LT = subs(eqn4LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn5LT = subs(eqn5LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn6LT = subs(eqn6LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn7LT = subs(eqn7LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn8LT = subs(eqn8LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn9LT = subs(eqn9LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);
eqn10LT = subs(eqn10LT,[laplace(ic1,t,s) laplace(ic2,t,s) laplace(ibp1,t,s) laplace(ibn1,t,s) laplace(ibp2,t,s) laplace(ibn2,t,s) laplace(vbp1,t,s) laplace(vbn1,t,s) laplace(vbp2,t,s) laplace(vbn2,t,s)],[Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2]);

% And rename the initial conditions by its names
eqn1LT = subs(eqn1LT,[ic1(0)],[0]);
eqn2LT = subs(eqn2LT,[ibp1(0)],[0]);
eqn3LT = subs(eqn3LT,[ibn1(0)],[0]);
eqn4LT = subs(eqn4LT,[ic2(0)],[0]);
eqn5LT = subs(eqn5LT,[ibp2(0)],[0]);
eqn6LT = subs(eqn6LT,[ibn2(0)],[0]);
eqn7LT = subs(eqn7LT,[vbp1(0)],[Vdc/2]);
eqn8LT = subs(eqn8LT,[vbn1(0)],[Vdc/2]);
eqn9LT = subs(eqn9LT,[vbp2(0)],[Vdc/2]);
eqn10LT = subs(eqn10LT,[vbn2(0)],[Vdc/2]);

% Solve the system in Laplace domain
eqns = [eqn1LT eqn2LT eqn3LT eqn4LT eqn5LT eqn6LT eqn7LT eqn8LT eqn9LT eqn10LT];
vars = [Ic1 Ic2 Ibp1 Ibn1 Ibp2 Ibn2 Vbp1 Vbn1 Vbp2 Vbn2];
[Ic1,Ic2,Ibp1,Ibn1,Ibp2,Ibn2,Vbp1,Vbn1,Vbp2,Vbn2] = solve(eqns,vars);


% Collect terms in powers of s
Ic1 = collect(Ic1,s); Ic2 = collect(Ic2,s); Ibp1 = collect(Ibp1,s); Ibn1 = collect(Ibn1,s);
Ibp2 = collect(Ibp2,s); Ibn2 = collect(Ibn2,s);
Vbp1 = collect(Vbp1,s); Vbn1 = collect(Vbn1,s); Vbp2 = collect(Vbp2,s); Vbn2 = collect(Vbn2,s);

clear eqn1LT eqn2LT eqn3LT eqn4LT eqn5LT eqn6LT eqn7LT eqn8LT eqn9LT eqn10LT eqns ic1 ic2 ibp1 ibn1 ibp2 ibn2 vbp1 vbn1 vbp2 vbn2 ode1 ode2 ode3 ode4 ode5 ode6 ode7 ode8 ode9 ode10 odes vars
%save('laplace_sol_v2_eqs')

%% P(s)
% All variables (Ic1, Ic2, etc) have the same denominator P(s)
P(s) = p9*s^9 + p8*s^8 + p7*s^7 + p6*s^6 + p5*s^5 + p4*s^4 + p3*s^3 + p2*s^2 + p1^s + p0;
% where
p9 = 2;
p8 = (2*ta1 + 2*ta2 + 2*tdc + 2*tdc1 + 2*tdc2 + 2*tfdc1 + 2*tfdc2);
p7 = (2*w1dc1 + 2*w2dc2 + 2*wa1 + 2*wa2 + 2*wn1 + 2*wn2 + 2*ta1*ta2 + 2*ta1*tdc + 2*ta1*tdc1 + 2*ta2*tdc + 2*ta1*tdc2 + 2*ta2*tdc1 + 2*ta2*tdc2 + 2*ta1*tfdc1 + 2*ta1*tfdc2 + 2*ta2*tfdc1 + 2*ta2*tfdc2 + 2*tdc*tdc1 + 2*tdc*tdc2 + 2*tdc1*tdc2 + 2*tdc*tfdc1 + 2*tdc*tfdc2 + 2*tdc1*tfdc2 + 2*tdc2*tfdc1);
p6 = (2*ta1*w1dc1 + 2*ta2*w1dc1 + 2*ta1*w2dc2 + 2*ta2*w2dc2 + 2*tdc*w1dc1 + 2*tdc2*w1dc1 + 2*tdc*w2dc2 + 2*tdc1*w2dc2 + 2*tfdc2*w1dc1 + 2*tfdc1*w2dc2 - 2*ta1*wa1 + 2*ta1*wa2 + 2*ta2*wa1 - 2*ta2*wa2 + 4*tdc*wa1 + 2*tdc*wa2 + 2*tdc1*wa1 + 2*tdc1*wa2 + 2*tdc2*wa1 + 2*tdc2*wa2 + 2*tfdc1*wa1 + 2*tfdc1*wa2 + 2*tfdc2*wa1 + 2*tfdc2*wa2 - 2*tdc*wdc2 + 2*ta1*wn1 + 2*ta1*wn2 + 2*ta2*wn1 + 2*ta2*wn2 + 2*tdc*wn2 + 2*tdc1*wn1 + 2*tdc1*wn2 + 2*tdc2*wn1 + 2*tdc2*wn2 + 2*tfdc1*wn1 + 2*tfdc1*wn2 + 2*tfdc2*wn1 + 2*tfdc2*wn2 + 2*ta1*ta2*tdc + 2*ta1*ta2*tdc1 + 2*ta1*ta2*tdc2 + 2*ta1*ta2*tfdc1 + 2*ta1*ta2*tfdc2 + 2*ta1*tdc*tdc1 + 2*ta1*tdc*tdc2 + 2*ta2*tdc*tdc1 + 2*ta1*tdc1*tdc2 + 2*ta2*tdc*tdc2 + 2*ta2*tdc1*tdc2 + 2*ta1*tdc*tfdc1 + 2*ta1*tdc*tfdc2 + 2*ta2*tdc*tfdc1 + 2*ta1*tdc1*tfdc2 + 2*ta1*tdc2*tfdc1 + 2*ta2*tdc*tfdc2 + 2*ta2*tdc1*tfdc2 + 2*ta2*tdc2*tfdc1 + 2*tdc*tdc1*tdc2 + 2*tdc*tdc1*tfdc2 + 2*tdc*tdc2*tfdc1);
p5 = (2*w1dc1*w2dc2 + 2*w1dc1*wa2 + 2*w2dc2*wa1 + 2*w1dc1*wn1 + 2*w1dc1*wn2 + 2*w2dc2*wn1 + 2*w2dc2*wn2 + 2*wa1*wa2 - 2*wdc1*wdc2 + 2*wa1*wn1 + 2*wa1*wn2 + 2*wa2*wn1 + 2*wa2*wn2 + 2*wn1*wn2 - 2*wa1^2 - 2*wa2^2 + 2*ta1*ta2*w1dc1 + 2*ta1*ta2*w2dc2 + 2*ta1*tdc*w1dc1 + 2*ta2*tdc*w1dc1 + 2*ta1*tdc2*w1dc1 + 2*ta2*tdc2*w1dc1 + 2*ta1*tdc*w2dc2 + 2*ta1*tdc1*w2dc2 + 2*ta2*tdc*w2dc2 + 2*ta2*tdc1*w2dc2 + 2*ta1*tfdc2*w1dc1 + 2*ta2*tfdc2*w1dc1 + 2*ta1*tfdc1*w2dc2 + 2*ta2*tfdc1*w2dc2 + 2*tdc*tdc2*w1dc1 + 2*tdc*tdc1*w2dc2 + 2*tdc*tfdc2*w1dc1 + 2*tdc*tfdc1*w2dc2 - 2*ta1*ta2*wa1 - 2*ta1*ta2*wa2 + 2*ta1*tdc*wa2 - 2*ta1*tdc1*wa1 + 4*ta2*tdc*wa1 + 2*ta1*tdc1*wa2 - 2*ta1*tdc2*wa1 - 2*ta2*tdc*wa2 + 2*ta2*tdc1*wa1 + 2*ta1*tdc2*wa2 - 2*ta2*tdc1*wa2 + 2*ta2*tdc2*wa1 - 2*ta2*tdc2*wa2 - 2*ta1*tfdc1*wa1 + 2*ta1*tfdc1*wa2 - 2*ta1*tfdc2*wa1 + 2*ta2*tfdc1*wa1 + 2*ta1*tfdc2*wa2 - 2*ta2*tfdc1*wa2 + 2*ta2*tfdc2*wa1 - 2*ta2*tfdc2*wa2 + 4*tdc*tdc1*wa1 - 2*ta1*tdc*wdc2 + 2*tdc*tdc1*wa2 + 4*tdc*tdc2*wa1 - 2*ta2*tdc*wdc2 + 2*tdc*tdc2*wa2 + 2*tdc1*tdc2*wa1 + 2*tdc1*tdc2*wa2 + 4*tdc*tfdc1*wa1 + 2*tdc*tfdc1*wa2 + 4*tdc*tfdc2*wa1 + 2*tdc*tfdc2*wa2 + 2*tdc1*tfdc2*wa1 + 2*tdc2*tfdc1*wa1 + 2*tdc1*tfdc2*wa2 + 2*tdc2*tfdc1*wa2 - 2*tdc*tdc1*wdc2 - 2*tdc*tdc2*wdc2 - 2*tdc*tfdc1*wdc2 - 2*tdc*tfdc2*wdc2 + 2*ta1*ta2*wn1 + 2*ta1*ta2*wn2 + 2*ta1*tdc*wn2 + 2*ta1*tdc1*wn1 + 2*ta1*tdc1*wn2 + 2*ta1*tdc2*wn1 + 2*ta2*tdc*wn2 + 2*ta2*tdc1*wn1 + 2*ta1*tdc2*wn2 + 2*ta2*tdc1*wn2 + 2*ta2*tdc2*wn1 + 2*ta2*tdc2*wn2 + 2*ta1*tfdc1*wn1 + 2*ta1*tfdc1*wn2 + 2*ta1*tfdc2*wn1 + 2*ta2*tfdc1*wn1 + 2*ta1*tfdc2*wn2 + 2*ta2*tfdc1*wn2 + 2*ta2*tfdc2*wn1 + 2*ta2*tfdc2*wn2 + 2*tdc*tdc1*wn2 + 2*tdc*tdc2*wn2 + 2*tdc1*tdc2*wn1 + 2*tdc1*tdc2*wn2 + 2*tdc*tfdc1*wn2 + 2*tdc*tfdc2*wn2 + 2*tdc1*tfdc2*wn1 + 2*tdc2*tfdc1*wn1 + 2*tdc1*tfdc2*wn2 + 2*tdc2*tfdc1*wn2 + 2*ta1*ta2*tdc*tdc1 + 2*ta1*ta2*tdc*tdc2 + 2*ta1*ta2*tdc1*tdc2 + 2*ta1*ta2*tdc*tfdc1 + 2*ta1*ta2*tdc*tfdc2 + 2*ta1*ta2*tdc1*tfdc2 + 2*ta1*ta2*tdc2*tfdc1 + 2*ta1*tdc*tdc1*tdc2 + 2*ta2*tdc*tdc1*tdc2 + 2*